import React, { useState } from 'react'
import Input from '../InputFields/Input'
import './edit.css'

const EditPage = (props) => {

    const { setIsEdit } = props

    const avaUrl = [
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,"
        , "data:image/jpeg;base64,"
        , "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSWa4kzPARuM_BavbHmeWfHiulcCx575DJygskNhx8L-A2rLGPKkuHQaIsaF6vYhw9UnSA&usqp=CAU"
        , "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcStmcfWnnWXXmLojOi53xz_L36qprpRtd8uOpG-ME9N191x_8LGuHGiRIUySBL9yzbI8gk&usqp=CAU"
        , "https://shopgarena.net/wp-content/uploads/2022/07/Anh-Chibi-Avatar-LQ-Hoat-Hoa-Kirito.jpg"

    ]
    const [name, setName] = useState("Victor Nguyen")
    const [age, setAge] = useState(22)
    const [about, setAbout] = useState("Coder")
    const [theme, setTheme] = useState("#ff9051")
    const [url, setUrl] = useState("https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/2bbad678-25db-4953-aed1-24f458d9e85b/dcmkj95-43c3862c-401d-4d0a-93f3-6f928304051e.png/v1/fill/w_894,h_894,strp/chibi_avatar___akiyama_mio_by_mrtapoz_kun_dcmkj95-pre.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..kia6Oe2hyd3p4HoY8aaruG3oisSJAa5y2yqxp8mSjmM")

    const handleSubmit = (e) => {
        e.preventDefault()
        setIsEdit(false)
    }

    return (
        <>
            <form onSubmit={handleSubmit}>
                <section className="edit-container">
                    <button className="close">SAVE</button>
                    <div className="edit-profile">
                        Edit Profile
                    </div>
                    <div className="input-container">
                        <Input label="Display name" data={name} setData={setName} />
                        <Input label="Age" data={age} setData={setAge} />
                        <Input label="Abour" data={about} setData={setAbout} inputType="textarea" classStyle="input-about" />
                        <label>Profile Picture</label>
                        <div className="input-image-container">
                            {avaUrl.map((url) => {
                                return (
                                    <>
                                        <img src={url} className="input-image" onClick={(e) => setUrl(e.target.src)} />
                                    </>
                                )
                            })}
                        </div>
                        <div className="theme-container">
                            <label>Theme</label>
                            <input type="color" className='theme-color' onChange={(e) => setTheme(e.target.value)} />
                        </div>
                    </div>
                </section>
            </form>
        </>
    )
}

export default EditPage